<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Handwriting Animation</title>
    <style>
        body {
            margin: 0;
            padding: 0;
        }
        .content.top {
            height: 100vh;
            width: 100vw;
            position: relative;
        }
        .content.topTitle {
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            width: 100vw;
            position: absolute;
            top: 0;
            left: 0;
        }
        .content.topTitle svg, .content.topTitle img, .content.topTitle video {
            display: flex;
            justify-content: center;
            align-items: center;
            object-fit: contain;
            position: absolute;
            --scale: calc(min(100vh, 100vw));
            height: var(--scale);
            width : var(--scale);
        }
        .content.topTitle video {
            opacity: 0;
            object-fit: cover;
            animation: topBackground 3s ease-in-out forwards;
            animation-delay: 3s;
        }
        @keyframes topBackground {
            0% {
                opacity: 0;
            }
            100% {
                opacity: .5;
            }
        }
        .content.topTitle svg {
            width: 80%;
            height: 100vh;
        }
        .content.topTitle svg path {
            fill: none;
            stroke: black;
            stroke-width: 2;
            stroke-dasharray: 0;
            stroke-dashoffset: 0;
            opacity: 0;
            /* animation: draw 3s ease-in-out forwards; */
            transform-origin: 50% 50%;
        }
        .content.topTitle svg path.countDown {
            animation-delay: 3s;
        }
        @keyframes draw {
            0% {
                stroke-dashoffset: var(--path-length);
            }
            50% {
                transform: translateY(0);
            }
            100% {
                stroke-dashoffset: 0;
            }
        }
        .content.top .button {
            position: absolute;
            right: 20px;
            bottom: 20px;
            backdrop-filter: blur(5px);
            --webkit-backdrop-filter: blur(5px);
            background-color: rgba(211, 211, 211, .25);
            box-shadow: 0 0 10px gray;
            border-radius: 40px;
            padding: 10px;
            height: min-content;
        }
        .emphasisText {
            font-size: 150%;
        }
        .content.main {
            min-height: 100vh;
        }
    </style>
</head>

                <g><path style="opacity:0.5" fill="#6a6b6a" d="M 44.5,952.5 C 44.8966,951.475 45.5632,951.308 46.5,952C 45.9056,952.464 45.2389,952.631 44.5,952.5 Z"/></g>
                <g><path style="opacity:0.578" fill="#2d2c2b" d="M 109.5,949.5 C 114.639,950.941 114.639,951.941 109.5,952.5C 109.5,951.5 109.5,950.5 109.5,949.5 Z"/></g> -->
            </svg>
        </div>
        <div class="button"></div>
    </div>
    <div class="main content">

    </div>

    <script>
        const d = document;
        const topContentButton = d.querySelector(".content.top .button");
        const topTitleContent  = d.querySelector(".content.topTitle");
        const paths = d.querySelectorAll(".content.topTitle path");

        (() => {

            window.addEventListener("DOMContentLoaded", () => {
                paths.forEach(path => {
                    const length = path.getTotalLength();

                    // CSS変数にパス長を代入
                    path.style.setProperty("--path-length", length);

                    // stroke-dasharray と stroke-dashoffset を初期化
                    path.style.strokeDasharray = length;
                    path.style.strokeDashoffset = length;

                    path.style.opacity = 1;
                    path.style.animation = "draw 3s ease-in-out forwards";
                });
            });

            // すべてのパスのバウンディングボックスを統合して viewBox を調整
            let minX = Infinity, minY = Infinity, maxX = -Infinity, maxY = -Infinity;
            paths.forEach(path => {
                const bbox = path.getBBox();
                if (bbox.x < minX) minX = bbox.x;
                if (bbox.y < minY) minY = bbox.y;
                if (bbox.x + bbox.width > maxX) maxX = bbox.x + bbox.width;
                if (bbox.y + bbox.height > maxY) maxY = bbox.y + bbox.height;
            });

            function windowResizeHandler() {
                topTitleContent.style.setProperty("--titleImageWidth", topTitleContent.clientWidth + "px");
            }
            windowResizeHandler();
            window.addEventListener("resize", windowResizeHandler);

            const svg = d.querySelector("svg");
            const margin = 0; // 余白
            svg.setAttribute(
                "viewBox",
                `${minX - margin} ${minY - margin} ${maxX - minX + margin*2} ${maxY - minY + margin*2}`
            );
        })();

        function dateUpdate () {
            const nowDate = new Date("2025-10-24");
            if (nowDate <= new Date("2025-10-26")) {
                const daysLeft = Math.ceil((new Date("2025-10-25") - nowDate) / (1000 * 60 * 60 * 24));
                let HTML = "あと&nbsp;" + "<span class='emphasisText'>" + daysLeft + "</span>" + "日";
                if (daysLeft < 1) {
                    HTML = "開催中";
                }
                topContentButton.innerHTML = HTML;
            } else {
                topContentButton.style.display = "none";
            }
        }
        dateUpdate();
        setInterval(dateUpdate, 10000);
    </script>
</body>
</html>
